import * as React from 'react';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { Link } from 'react-router-dom';
import { createTheme, ThemeProvider } from '@mui/material/styles';



const theme = createTheme();

export default function Home() {
      

    return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <main>
        {/* Hero unit */}
        <Box sx={{ bgcolor: 'background.paper', pt: 8, pb: 16, }} >
          <Container maxWidth="sm">
            <Typography component="h1" variant="h2" align="center" color="text.primary" gutterBottom>
              Python AI
            </Typography>
            <Typography variant="h5" align="center" color="text.secondary" paragraph>
              Have some fun with our Python AI tools.
            </Typography>
            <Stack sx={{ pt: 4 }} direction="row" spacing={2} justifyContent="center" >
              <Link to="/face_swapper">
                <Button style={{backgroundColor: "#97CC04"}} variant="contained">Face swapper</Button>
              </Link>
              <Link to="/face_filter">
                <Button style={{color: "#2D7DD2", border: "1px solid #2D7DD2"}} variant="outlined">Face Filter</Button>
              </Link>
            </Stack>
          </Container>
        </Box>

      </main>

    </ThemeProvider>
  );
}
